   return (
    <>

      <div className="note" >
        <h4 className="dateNote">mercredi 26 janvier 2022</h4>
        <textarea className="posteBorder"  value={post.type}>{post.type}</textarea>
      </div>

    </>
  )
}

export default PosteNote;
